import { AppBar, Toolbar, Typography } from "@mui/material"

export const Navbar = () => {
    return (
        <AppBar position='static'>
            <Toolbar>
                <Typography variant='h6' component='div' sx={{ flex}}>
                    EpiMoRPH Geo Builder
                </Typography>
            </Toolbar>
        </AppBar>
    )
}
